  true,\n\t\"url\": null,\n\t\"notes\": \"This annual report provides program and
  demographic information on the people who receive Social Security Disability Insurance
  Program benefits. This edition presents a series of detailed tables on the three
  categories of beneficiaries disabled workers, disabled widowers, and disabled adult
  children. Numbers presented in these tables may differ slightly from other published
  statistics because 100 percent data files for most tables were used and 1 percent
  file for calendar year 2000 awards data was used.\",\n\t\"license_title\": \"Creative
